class ErrorBoundary extends React.Component {
  constructor(props) {
    super(props);
    this.state = { hasError: false, error: null };
  }

  static getDerivedStateFromError(error) {
    return { hasError: true, error };
  }

  componentDidCatch(error, errorInfo) {
    console.error('ErrorBoundary caught an error:', error, errorInfo.componentStack);
  }

  render() {
    if (this.state.hasError) {
      return (
        <div className="min-h-screen flex items-center justify-center bg-gray-50">
          <div className="text-center">
            <h1 className="text-2xl font-bold text-gray-900 mb-4">Something went wrong</h1>
            <button onClick={() => window.location.reload()} className="btn btn-primary">
              Reload Page
            </button>
          </div>
        </div>
      );
    }
    return this.props.children;
  }
}

function MembersApp() {
  try {
    const [members] = React.useState([
      { id: 1, name: 'Rajesh Kumar', flatNo: '101', phone: '+91 98765 43210', email: 'rajesh@email.com', balance: 0, status: 'active' },
      { id: 2, name: 'Priya Sharma', flatNo: '205', phone: '+91 98765 43211', email: 'priya@email.com', balance: 0, status: 'active' },
      { id: 3, name: 'Amit Patel', flatNo: '302', phone: '+91 98765 43212', email: 'amit@email.com', balance: 2500, status: 'pending' },
      { id: 4, name: 'Sunita Reddy', flatNo: '408', phone: '+91 98765 43213', email: 'sunita@email.com', balance: 0, status: 'active' },
      { id: 5, name: 'Vikram Singh', flatNo: '510', phone: '+91 98765 43214', email: 'vikram@email.com', balance: 5000, status: 'overdue' }
    ]);

    const [searchTerm, setSearchTerm] = React.useState('');

    const filteredMembers = members.filter(member => 
      member.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      member.flatNo.includes(searchTerm)
    );

    return (
      <div className="min-h-screen" data-name="members-app" data-file="members-app.js">
        <Header />
        <main className="max-w-7xl mx-auto px-4 py-8">
          <div className="flex items-center justify-between mb-8">
            <div>
              <h1 className="text-3xl font-bold text-[var(--text-primary)] mb-2">Members</h1>
              <p className="text-[var(--text-secondary)]">Manage society members and their information</p>
            </div>
            <button className="btn btn-primary">
              <div className="flex items-center gap-2">
                <div className="icon-user-plus text-lg"></div>
                <span>Add Member</span>
              </div>
            </button>
          </div>

          <div className="card mb-6">
            <div className="relative">
              <div className="icon-search text-lg text-[var(--text-secondary)] absolute left-3 top-1/2 -translate-y-1/2"></div>
              <input
                type="text"
                placeholder="Search by name or flat number..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="w-full pl-12 pr-4 py-3 border border-[var(--border-color)] rounded-lg focus:outline-none focus:ring-2 focus:ring-[var(--primary-color)]"
              />
            </div>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {filteredMembers.map(member => (
              <MemberCard key={member.id} member={member} />
            ))}
          </div>
        </main>
      </div>
    );
  } catch (error) {
    console.error('MembersApp component error:', error);
    return null;
  }
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <ErrorBoundary>
    <MembersApp />
  </ErrorBoundary>
);
